    - type: Paper
      content: >-
        Я сбежал из того подвала... Черт.. Вормут... Он закрыл врата в подвал, я же прихвотил с собой энергоячейку.

        Саму "батарейку" я спрятал за дверьми, ключ же выбросил в мусорку, но черт подери я встретил одного из них и он сильно ранил меня, думаю, я уже не выберусь отсюда...

        Если это кто-то читает, то пульт от подвала находится в разрушенной лабаратории, туда убежал Хенри... я надеюсь он сможет выбраться...
  - uid: 6057
    components:
    - type: Transform
      pos: 53.567177,-20.335009
      parent: 1
    - type: Paper
      content: >-
        ЧЕРТ! Я видел как эта тьма буквально растворила человека на глазах!

        Я просто не ебу какого хера тут творится!

        Я понял только что в темноту без света лезть вообще не вариант, а так же что все кого растворило как будто возродились и начали нападать на других людей!

        Просто блять прекрасно, я надеюсь нам вызовут помощь, а то не думаю что света у меня останется на долго...
  - uid: 6058
    components:
    - type: Transform
      pos: 101.624344,11.762008
      parent: 1
    - type: Paper
      content: >-
        Уже прошло 3 дня с момента аварии, мы просто заперлись в этом магазине, продукты испортились, а выпускать нас не особо хотят.

        Эти двоя слишком часто смотрятна мои припасы, а припасов то мало у нас, нужно что то делать...
  - uid: 6059
    components:
    - type: Transform
      rot: 1.5707963267948966 rad
      pos: 71.630615,78.64768
      parent: 1
    - type: Paper
      content: >-
        Чертов Кепел! Его эксперементы явно зашли слишком далеко! Я говорил ему что-бы он не переходил границы, но нет! 

        Этот псих начал ставить эксперементы на заключённых! И ещё эта тьма, чёрт, после аварии солнце будто исчезло!

        Судя по последним нашим иследованиям во тьме находится какой то вирус или я не знаю что это блять!

        Блять, Рапура раздавило булыжником! У нас блять обвал произошёл, нахуя строить иследовательскую базу в этом каньёне?

        Чем блять они думали!


        Я не знаю какого черта, н Рапур стал совсем другим! Да он теперь блять скелет ходячий!

        Он ломится ко мне, черт, если это кто то читает, то знайте что во всём виноват Копел!
  - uid: 6060
    components:
    - type: Transform
      pos: 157.44153,12.350095
      parent: 1
    - type: Paper
      content: >-
        Если это кто-то читает... Что мало вероятно, но всё таки

        Меня зовут Эфрейд Донки, а тот кто виноват во всём этом - Копер... Ненадо было мне с ним водится... 

        Меня назначили сюда к Коперу, тогда я не знал насколько он психопат, но всё таки, как он сам поведал мне, он с иследовательской группой нашли тут странный артефакт, похожим ему никогда ненаходили.

        После он получил разрешение построить тут что-то типо иследовательской базы с маленьким заводом, сама база в каньёне, где собственно и был найден артефакт.

        Но база эта поделена на 2 части вратами, и чертов копер явно заранее знал что произойдёт и сбежал за день до аварии!

        При этом прихватил с собой артефакт и 3 научных сотрудников. Я видел то чтов вылезло из лаборатории... господи, оно успело пробежать за врата... я никогда такой твари не видел и уже не увижу...

        И видимо запасной ключ он специально оставил в том подвале... Но там защита что чёрт ногу сломит.

        А чертов ключ от личного бункера мне уже не к чему, я врядли выйду с этого подвала...
  - uid: 6061
    components:
    - type: Transform
      pos: 152.25107,74.82283
      parent: 1
    - type: Paper
      content: >-
        Мы почти смогли... Я смог закрыть двери в последнйи момент, но мои ноги.. черт... Я приказал Митчелу бежать что есть мочи, сам то я не уйду уже.

        Этот слепой монстр оказывается слишком хорошо слышит! Он поубивал всех моих ребят... А ведь мы почти открыли двери..
  - uid: 6067
    components:
