        Да и ещё эти ублюдки, просто бросили нас тут помирать закрыв врата!

        Если бы не его эксперементы ничего бы не случилось!

        Эти твари благо боятся света...

        Сука, ребят жаль, не успели в бункер забежать

        Нужно собрать вещи и пойти найти способ открыть ебучие ворота.
